// App.js
import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

const Header = () => {
  return (
    <header>
      <h1>Нове Тіло Фітнес Клуб</h1>
    </header>
  );
};

const Navigation = () => {
  const [navHovered, setNavHovered] = useState(false);

  const handleNavHover = () => {
    setNavHovered(!navHovered);
  };

  return (
    <nav>
      <ul>
        <li>
          <Link to="/" className={navHovered ? 'hovered' : ''}>
            Головна Сторінка
          </Link>
        </li>
        <li>
          <Link to="/training" className={navHovered ? 'hovered' : ''}>
            Про Нас
          </Link>
        </li>
        <li>
          <Link to="/schedule" className={navHovered ? 'hovered' : ''}>
            Цінові Плани та Акції
          </Link>
        </li>
      </ul>
    </nav>
  );
};

const WelcomeSection = () => {
  return (
    <main>
      <h2>Привітання та Запрошення</h2>
      <p>Ласкаво просимо в Nove Tilo Fitnes Klub! Запрошуємо вас в наш фітнес-зал, де ви зможете досягти своїх фітнес-цілей та покращити своє здоров'я.</p>
    </main>
  );
};

const TrainingZonesSection = () => {
  return (
    <main>
      <h2>Зоны Тренувань</h2>
      {/* Додайте вміст для зон тренувань */}
    </main>
  );
};

const ScheduleSection = () => {
  return (
    <main>
      <h2 id="schedule">Розклад Роботи</h2>
      {/* Додайте вміст для розкладу роботи */}
    </main>
  );
};

const App = () => {
  return (
    <Router>
      <div>
        <Header />
        <Navigation />
        <Routes>
          <Route path="/" element={<WelcomeSection />} />
          <Route path="/training" element={<TrainingZonesSection />} />
          <Route path="/schedule" element={<ScheduleSection />} />
        </Routes>
        <footer>
          <p>Долучайтесь до нас:</p>
          <a href="https://www.instagram.com/" target="_blank" rel="noreferrer">Instagram</a> |
          <a href="https://www.facebook.com/" target="_blank" rel="noreferrer">Facebook</a> |
          <a href="mailto:info@example.com">Електронна пошта</a> |
          Телефон: +123456789
        </footer>
      </div>
    </Router>
  );
};

export default App;
